// Zone des fonctions -------------------------------------
	create:function() {
		this.inherited(arguments);
 
		try {
			queryString = window.location.search;
			urlParams = new URLSearchParams(queryString);
			recherche_a_realiser = urlParams.get('search');
			console.log(recherche_a_realiser);
			if (recherche_a_realiser != "none") {
				this.$.performSearch.setValue(recherche_a_realiser);
				this.SearchMol();
			}
		} catch (error) {}
	},
	setupItemMOL: function(inSender, inEvent) {
		var index = inEvent.index;
		var item = inEvent.item;
		
		Drapeaux1 = ["(UK", "(US", "(DE", "(FR", "(ES", "(AU", "(NL", "(HR", "(FI", "(NO", "(DK", "(IT", "(PT", "(SE", "(TR", "(HR", "(PL", "(JP", "(EU"]

		// traitement des drapeaux ----
		Drapeau = ""
		for (i = 0;i < Drapeaux1.length;i++) { 
			if ( son_list_database_tri[index].indexOf(Drapeaux1[i]) != -1 )
			{
				Drapeau = Drapeau + "<img src=assets/" + Drapeaux1[i].substring(1) + ".jpg width=28>"
			}
		}
		if (Provenance=="Search") {
			Spotify = "<a href=https://open.spotify.com/search/" + encodeURI(son_list_database_tri[index].split(";")[0] + " " + son_list_database_tri[index].split(";")[1]) + " target=_blank><img src=assets/spotify.png width=25></a>"
			Deezer = "<a href=https://www.deezer.com/search/" + encodeURI(son_list_database_tri[index].split(";")[0] + " " + son_list_database_tri[index].split(";")[1]) + " target=_blank><img src=assets/deezer.png width=25></a>"
			Youtube = "<a href=https://www.youtube.com/results?search_query=" + encodeURI(son_list_database_tri[index].split(";")[0] + " " + son_list_database_tri[index].split(";")[1]) + " target=_blank><img src=assets/youtube.png width=25></a>"
			item.$.MOLItem.setContent("<table><tr><td><a href=games.html?game=" + encodeURI(son_list_database_tri[index].split(";")[2]) + "&incoming=" + encodeURI(this.$.performSearch.getValue().trim()) + " ><img src=assets/" + encodeURI(son_list_database_tri[index].split(";")[2]) + ".jpg width=100 height=150></a>&nbsp;&nbsp;</td><td><font size=4><a href=games.html?game=" + encodeURI(son_list_database_tri[index].split(";")[2]) + "&incoming=" + encodeURI(this.$.performSearch.getValue().trim()) + ">" + son_list_database_tri[index].split(";")[2] + "</a></font><br/><br/>" + Drapeau + "<br/><br/><font size=3>" + son_list_database_tri[index].split(";")[0] + "</font><br/><font size=4><i>" + son_list_database_tri[index].split(";")[1] + "<br/>" + Youtube + "&nbsp;"  + Spotify + "&nbsp;" + Deezer + "</font></td></tr></table>");
			if (index%2==0) {
				item.$.MOLItem.setStyle("padding:8px;width:100%;background-color:LEMONCHIFFON");
			} else {
				item.$.MOLItem.setStyle("padding:8px;width:100%;background-color:white");
			}
		}
		
		if (Provenance=="AllGames") {
			item.$.MOLItem.setContent("<table><tr><td><a href=games.html?game=" + encodeURI(son_list_database_tri[index].split(";")[0]) + "&incoming=none target=_blank><img src=assets/" + encodeURI(son_list_database_tri[index].split(";")[0]) + ".jpg width=100 height=150></a>&nbsp;&nbsp;</td><td><font size=4><a href=games.html?game=" + encodeURI(son_list_database_tri[index].split(";")[0]) + "&incoming=none target=_blank >" + son_list_database_tri[index].split(";")[0] + "</a></font><br/><br/>" + Drapeau + "</font></td></tr></table>");
			if (index%2==0) {
				item.$.MOLItem.setStyle("padding:8px;width:100%;background-color:LEMONCHIFFON");
			} else {
				item.$.MOLItem.setStyle("padding:8px;width:100%;background-color:white");
			}
		}
	},
